import react from 'react';
import './style.scss'
import Player from '../../container/flexLives/player';
import { monster } from '../../utils'

const flexLives = ({ playerName, level } : any) => (
  <div className="flexLives">
    <Player namePlayer={playerName} picture={'warrior.png'} id={'player'}/>
    <Player namePlayer={monster[level]} picture={monster[level]+'.png'} id={'monster'}/>
  </div>
)
export default flexLives
